// UTM параметры
//==============
    var getUrlParameter = function getUrlParameter(sParam) {
        var sPageURL = window.location.search.substring(1),
            sURLVariables = sPageURL.split('&'),
            sParameterName,
            i;

        for (i = 0; i < sURLVariables.length; i++) {
            sParameterName = sURLVariables[i].split('=');

            if (sParameterName[0] === sParam) {
                return sParameterName[1] === undefined ? true : decodeURIComponent(sParameterName[1]);
            }
        }
    };
    var utm_source = getUrlParameter('utm_source');
    var utm_medium = getUrlParameter('utm_medium');
    var utm_campaign = getUrlParameter('utm_campaign');
    var utm_content = getUrlParameter('utm_content');
    var utm_term = getUrlParameter('utm_term');

    if(utm_source){
        $("form").prepend('<input type="hidden" name="utm" value="utm_source=<strong>'+utm_source+'</strong><br>utm_medium=<strong>'+utm_medium+'</strong><br>utm_campaign=<strong>'+utm_campaign+'</strong><br>utm_content=<strong>'+utm_content+'</strong><br>utm_term=<strong>'+utm_term+'</strong>">');
    }

